import React, { useState } from 'react';
import './Rooms.css'


export default function Arrays() {

  const [rooms, setRoom] = useState([
    {"name": "1"},
    {"name": "2"},
    {"name": "1"},
    {"name": "1"},
    {"name": "1"},

  ])

  const renderRooms = () => {
    return rooms.map((room, n) => {
       return (<li className="room"> <div>{n + 1}</div> </li>);
    })
  }


  return (
    <ul className = "roomList">{renderRooms()}</ul>
  )

}
